import { BiCameraMovie } from "react-icons/bi";
import { Link } from "react-router-dom";

const Item = function ({ name, description, score }) {
  return (
    
      <li>
        <BiCameraMovie />
        <strong>{name}</strong>
        <small>- {description}</small>
      <em>score: {score}</em>
      <Link to="/">
        <button></button>
      </Link>
      </li>
  );
};

export default Item;
